import React from 'react';
import 'antd/dist/antd.css';
import { Form, Input, Button, Checkbox} from 'antd';
import './custom.css'
import { Label } from 'semantic-ui-react'

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      user: '',
      pass: ''
    };
  }

   layout = {
    labelCol: {
      span: 8,
    },
    wrapperCol: {
      span: 16,
    },
  };
   tailLayout = {
    wrapperCol: {
      offset: 8,
      span: 16,
    },
  };

  tailLayout1 = {
    wrapperCol: {
      offset: 6,
      span: 16,
    },
  };

  onClick = (ttt) => {
    console.log('EIEI:');
    console.log(this.state.user);
    console.log(ttt);
  };

  onChangeUser = (e) => {
    this.setState({user:e.target.value})
  };

  render() {
    return (
      <div class='centered'>
        <div class='backgrond' style={{backgroundColor:'rgba(52, 52, 52, 0.8)'}}>
          <Form {...this.layout} name="basic" initialValues={{ remember: true }}>
          <Form.Item {...this.tailLayout1} name="remember" valuePropName="checked">
            <label style={{ color: 'white',fontWeight:'bold' }}>WELLCOME TO BOOKSTORE</label>
          </Form.Item>

          <Form.Item label={<label style={{ color: 'white',fontWeight:'bold' }}>Username</label>} name="username" rules={[{ required: true, message: 'Please input your username!' }]} >
            <Input value={this.state.user} onChange={this.onChangeUser}/>
          </Form.Item>

          <Form.Item  label={<label style={{ color: 'white',fontWeight:'bold' }}>Password</label>}  name="password" rules={[{ required: true, message: 'Please input your password!' }]} >
            <Input.Password />
          </Form.Item>

          <Form.Item {...this.tailLayout1}>
            <div>
              <Button onClick = {() => this.onClick("TTT")} style = {{ width: '10vh'}} type="primary" >
                Submit
              </Button>
              &nbsp;
              &nbsp;
              &nbsp;
              <Button style = {{ width: '10vh'}} type="primary" >
                Reset
              </Button>
            </div>
          </Form.Item>


            <li>Register</li>
        </Form>
        </div>

      </div>
    );
  }
}
